import {
  Outlet,
  Link
} from "react-router-dom";

function App() {
  return (
    <div>
      <h1>Bookkeeper!</h1>
      <nav
        style={{
          borderBottom: "solid 1px",
          paddingBottom: "1rem"
        }}
      >
        <Link to="/invoices">Invoices</Link> |{" "}
        <Link to="/expenses">Expenses</Link>
      </nav>
      <p>Test!</p>
      <Outlet />
    </div>
  );
}

export default App;
